\fs22 \cf2 The first step that takes place once the pipeline is launched, is to create several objects within the python interpreter\'92s memory. Using the information contained in the metadata excel file, a \'93Project\'94 object is instantiated with the relevant attributes. Next, for each sample present within the project, several \'93Sample\'94 objects are created and attached to the \'93Project\'94. Each of these objects have methods and properties that enable the pipeline to operate. More information at .}

