\f0\fs26 \cf2 \expnd0\expndtw0\kerning0
Primer presence check\
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720

\fs22 \cf2 We search for the forward primer and reverse primer at the start and end of each read respectively. Prior to this search the reads are flipped to all run from the 3' to the  5' of the 16S RNA gene using the barcodes for orientation. Most reads have both primers in the expected positions, some reads only have one of the two primers and some are missing the primers entirely.
\fs24 \cf2  
\fs22 \cf2 At this stage, only reads with good primers are kept for further processing.}

